import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      plants: [
        {
          name: 'Snake',
          id: 'abc1' 
        },
        {
          name: 'Aloe Vera',
          id: 'abc2'
        },
        {
          name: 'Hibiscus',
          id: 'abc3'
        },
      ]
    };
  }

  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/users')
      .then(response =>
        response.json())
  }


  render() {
    return (
      <div className="App">
        {this.state.plants.map (
          plant => (
            <h1 key = {plant.id}>{plant.name}</h1>
          )
        )
      }
      </div>
    );
  }
}

export default App;
